//React
import React, { Component } from "react";

//React Router
import { Link } from "react-router-dom";

//Pages
import Home from "./home";

//Bootstrap Components
import { Col, Container, Row } from "react-bootstrap";
import Form from "react-bootstrap/Form";
import Button from "react-bootstrap/Button";

//Components

class CardSignIn extends Component {
  render() {
    return (
        <div className="cardSignIn">
          <Container>
            <Row className="justify-content-center">
              <Col sm={12} lg={6}>
                <Col className="shadow cardWidget">
                  <div className="textAlignCenter">
                    <i class="lni lni-32 lni-capsule"></i>
                    <h2 className="static400">Verify Eligibility & Benefits</h2>
                  </div>
                  <hr />
                  <Form>
                    <Form.Group controlId="formBasicEmail">
                      <Form.Label>Optum ID</Form.Label>
                      <Form.Control type="email" placeholder="" />
                      <Form.Text className="text-muted">
                        {/* We'll never share your email with anyone else. */}
                      </Form.Text>
                    </Form.Group>
                    <Form.Group controlId="formBasicPassword">
                      <Form.Label>Password</Form.Label>
                      <Form.Control type="password" placeholder="" />
                      <Form.Text className="text-muted">
                        {/* We'll never share your email with anyone else. */}
                      </Form.Text>
                    </Form.Group>
                    <Form.Group controlId="formBasicCheckbox">
                      <Form.Check type="checkbox" label="Check me out" />
                    </Form.Group>
                    <Link to='./home'>
                    <Button variant="primary" block type="submit">
                      Submit
                    </Button>
                    </Link>
                    <div className="links">
                      <a href="#">Forgot Optum ID</a>
                      <a href="#">Forgot Password</a>
                    </div>
                  </Form>
                </Col>
              </Col>
            </Row>
          </Container>
          <Home />
        </div>
    );
  }
}

export default CardSignIn;
